import "./HomePage.css";

export default function HomePage() {
  return (


    <div>

    <TopBar />
      <div className="Hero" style={{width: window.visualViewport.width, height: window.visualViewport.height}}>
        <div id="EndWaves">
          <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 1440 320">
            <path
              fill="#0099ff"
              fill-opacity="1"
              d="M0,160L60,181.3C120,203,240,245,360,256C480,267,600,245,720,224C840,203,960,181,1080,186.7C1200,192,1320,224,1380,240L1440,256L1440,320L1380,320C1320,320,1200,320,1080,320C960,320,840,320,720,320C600,320,480,320,360,320C240,320,120,320,60,320L0,320Z"
            ></path>
          </svg>
        </div>
      </div>

      <div className="Blog" style={{width: window.visualViewport.width, height: window.visualViewport.height}}>

      </div>
    </div>
  );
}
